package main

import (
	"fmt"
	"github.com/golang/geo/s2"
	"github.com/lucasb-eyer/go-colorful"
)

func init() {
	loadMapping()
	//populate colors and disabled
	for i, p := range pixels {
		if p == nil {
			pixels[i] = &GlobePixel{disabled: true}
		}
		pixels[i].color = &colorful.Color{}
	}

	//populate cellIds, rows, and columns
	for _, p := range pixels {
		if !p.disabled {
			if rows[p.row] == nil {
				rows[p.row] = make([]*GlobePixel, 0)
			}
			rows[p.row] = append(rows[p.row], p)

			if cols[p.col] == nil {
				cols[p.col] = make([]*GlobePixel, 0)
			}
			cols[p.col] = append(cols[p.col], p)
		}
	}

	fmt.Printf("pixel count: %d\n", len(pixels))
	fmt.Printf("row count: %d\n", len(rows))
	fmt.Printf("col count: %d\n", len(cols))
}

func point(lat, lon float64) s2.Point {
	return s2.PointFromLatLng(s2.LatLngFromDegrees(lat, lon))
}

